The Sheckler Virtual Choir is thrilled to present our latest project, a collaboration with the iconic GRAMMY Award-winning artist Gloria Gaynor, on her inspiring track “Talkin’ ‘Bout Jesus”. This video represents a fusion of classic soul with the innovative spirit of virtual performance. Thank you to all who made this collaboration possible! The full video can be found on Gloria Gaynor’s YouTube page. Link in Bio.

